import React from 'react';
import { NavLink } from 'react-router-dom';
import Users from '../../Users';

import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,

} from 'reactstrap';

import './header.css';

class Header extends React.Component<any, any>{

    constructor(props: any) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }

    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }

    render() {
        return (
            <div id="header-container">
                <Navbar color="light" light expand="md">
                    <NavbarBrand ><NavLink to="/">HashedIN</NavLink></NavbarBrand>
                    <NavbarToggler  onClick={this.toggle} >

                    </NavbarToggler>
                    <Collapse isOpen={this.state.isOpen} navbar>
                        <Nav className="ml-auto" navbar>
                            <NavItem>
                                <NavLink to="/users" onClick={this.toggle}>course</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink to="/users" onClick={this.toggle}>Mywishlist</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink to="/users" onClick={this.toggle}>cart</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink to="/Users" onClick={this.toggle}>profile</NavLink>
                            </NavItem>

                        </Nav>
                    </Collapse>
                </Navbar>


            </div>
        )
    }
}

export default Header;
